import "./Kush.css";
export const ProjectDetailed = ({ title, description, imgUrl }) => {
  return (
    <Container>
    <h1 > {title} </h1>
    <h3 > {description} </h3>
    <h3 > Deadline : {description} </h3>
    </Container>

  )
}
